import { useEffect, useState } from 'react';
import './Movies.scss';
import axios from 'axios';


const Movies = () => {
    const [movies, setMovies] = useState([])

    useEffect(() => {
        getMovies()
    }, [])



    function getMovies() {
        axios.get('https://jsonplaceholder.typicode.com/users')
            .then(res => {
                setMovies([res?.data]);
                console.log('Movies', movies)
            }) 
    }

    return (
        <div>MOvies</div>
    )
}

export default Movies;
